import axios from 'axios'
import React, { useState } from 'react'

 const App = () => { 
     const [value,setValue]= useState("")
     axios
     .get("https://api.themoviedb.org/3/movie/550?api_key=e9ffcce562635a23124ca8069487f842")
     .then(res=>res.data)
     .then(valor=>setValue(valor))
  return (
    <div>{value}</div>
  )
}

export default App
